function isover18(dateofbirth){
	const date18yrsago = new Date();
	date18yrsago.setFullYear(date18yrsago.getFullYear() - 18);
	return dateofbirth <= date18yrsago;
}
function getPic(n){
	if(n==1){
		return 'data:image/png;base64,';
		
	}else if(n==2){
		return `data:image/png;base64,`;
	}
}
